import Layout from '../components/MyLayout.js'
import Link from 'next/link'

const Index = () => (
  <div>
    <p>Magic 8 Ball</p>
  </div>
)

const PostLink = (props) => (
  <li>
    <Link as={`/p/${props.id}`} href={`/post?title=${props.title}`}>
      <a>{props.title}</a>
    </Link>
  </li>
)

export default () => (
  <Layout>
    <h1>Magic 8 Ball</h1>
  </Layout>
)
